          padding: "5px",
          margin : "5px",
          height: "30%"
        },
        text:{
          margin : "5%" 
        }
    }

    const enabled = useMemo(()=> isEnabled(item),[item,isEnabled])

    return (
      <div style={styles.root}>
       <span style={styles.text}>
        {item.name}
        </span>
        <span style={styles.text}>
        {item.type}
        </span>
        <span style={styles.text}>
        {item.price}
        </span>
    {item.price<=deposit? <span>{item.pice}ok</span>:<span>{item.pice}</span>}
      </div>
    );
  }
